	'use strict';



var info = {};

var init = {
	init: function() {
		var _this = this;

		_this.parseData();
		list.init();
		_this.post();
	},

	parseData: function() {
		var _this = this;

		// var q = queue();

		// q.defer(d3.csv, '../data/arctic2015.csv')
		// 	.defer(d3.json, '../shapes/world_topo_s.json')
		// 	.await();

		info.list = [];
		info.lookup = {};
		info.tastes = [];
		info.avgs = {};
		info.collection = [];
		info.row = null;

		scotch_info.forEach(function(d, i) {
			d.slug = helpers.slugify(d.name);
			d.id = i;
			info.list.push(d);

			// slugs.push(d.slug);
			info.collection.push(i);
		});

		scotch_simil.forEach(function(d, i) {
			var name = d.distill,
				slug = helpers.slugify(name);

			info.lookup[slug] = [];

			for (var key in d) {
				if (key !== 'distill' && key !== name) {
					var spaceName = key.split('_').join(' '),
						value = {
							distillery: spaceName,
							slug: helpers.slugify(spaceName),
							val: d[key]
						};
					info.lookup[slug].push(value);
				}
			}
		});

		for (var key in info.lookup) {
			var values = info.lookup[key];

			values.sort(helpers.valSort);
		}

		var len = scotch_info.length;

		scotch_info.forEach(function(d, i) {
			for (var key in d) {
				if (key !== 'name' && key !== 'region' && key !== 'id' && key !== 'slug') {
					if (typeof info.avgs[key] === 'undefined') {
						info.avgs[key] = 0;
						info.tastes.push(key);
					}

					var val = parseInt(d[key], 10);
					
					info.avgs[key] += val;
				}
			}
		});

		for (var key in info.avgs) {
			var total = info.avgs[key],
				avg = total / len,
				avgRound = Math.round(avg * 100) / 100;

			info.avgs[key] = avgRound;
		}

		console.log(info)

	},

	post: function() {
		window.onresize = function() {

		};
	}

};

var list = {
	$parent: document.getElementById('js-list'),

	init: function() {
		var _this = this;

		_this.getWidth();

		dodecagon.init();
		_this.draw();
		panel.init();
	},

	getWidth: function() {
		var _this = this,
			W = _this.$parent.offsetWidth;

		_this.numInRow = Math.floor(W / 150);

		_this.sectionp = 100 / _this.numInRow;
		_this.sectionw = W / _this.numInRow;
		_this.w = _this.sectionw * 0.8;
	},

	draw: function() {
		var _this = this;

		var wrapper = d3.select(_this.$parent);

		var section = wrapper.selectAll('.section')
			.data(info.list)
			.enter().append('div')
			.attr('id', function(d) {
				return 'js-section-' + d.id;
			})
			.attr('class', 'section cf')
			.style('width', _this.sectionp + '%');

		section.append('p')
			.attr('class', 'label-taste');

		dodecagon.draw(section);

		var label = section.append('p')
			.attr('class', 'label-section')
			.text(function(d) {
				return d.name;
			});		
	}

};

var dodecagon = {
	numSides: 12,
	padding: 4,
	// line: d3.svg.line().x(function(d) { return d[0]; }).y(function(d) { return d[1]; }).interpolate('linear'),
	rawLine: function(d) {
		return 'M' + d.join('L') + 'Z';
	},
	

	init: function() {
		var _this = this;

		_this.line = d3.svg.line()
			.x(function(d) { return d[0]; })
			.y(function(d) { return d[1]; })
			.interpolate('linear');

		_this.voronoi = d3.geom.voronoi()
			.clipExtent([[0, 0], [list.w, list.w]]);

		_this.setRadius();

		_this.vertices = _this.getVertices();
		_this.vertices_s = _this.vertices.slice(0, -1),
		_this.avgPath = _this.getAvgPath(info.avgs);
	},

	setRadius: function() {
		var _this = this;

		_this.r = (list.w - (_this.padding * 2)) / 2,
		_this.centerPt = [_this.r, _this.r],
		_this.a = 360 / _this.numSides,
		_this.mult = _this.r / 5;
	},

	draw: function(section) {
		var _this = this;

		var svg = section.append('div')
			.attr('class', 'dodecagon')
			.style('width', list.w + 'px')
			.append('svg')
			.attr('width', list.w)
			.attr('height', list.w)
			.append('g')
			.attr('transform', 'translate(' + _this.padding + ',' + _this.padding + ')');

		svg.append('path')
			.datum(_this.vertices)
			.attr('class', 'path-outer')
			.attr('d', _this.line);

		svg.append('path')
			.datum(_this.avgPath)
			.attr('class', 'path-avg')
			.attr('d', _this.line);

		svg.append('path')
			.datum(function(d) {
				var vs = _this.getAvgPath(d);
				return vs;
			})
			.attr('class', 'path-ownAvg')
			.attr('d', _this.line);

		_this.addFocus(svg);
		_this.addCenter(svg);
		_this.addVoronoi(svg);		
	},

	addFocus: function(svg) {
		var focus = svg.append('g')
			.attr('id', function(d) {
				return 'js-focus-' + d.id;
			})
			.attr('class', 'focus')
			.style('display', 'none');
				
		focus.append('circle')
			.attr('r', 3);
	},

	addCenter: function(svg) {
		var _this = this;

		var cWrapper = svg.append('g')
			.attr('id', function(d) {
				return 'centerWrapper-' + d.id;
			});

		cWrapper.selectAll('.path-vertices')
			.data(_this.vertices_s)
			.enter().append('path')
			.attr('id', function(d, i) {
				var id = this.parentNode.id,
					idNum = id.split('-')[1];
				return 'js-vertice-' + idNum + '-' + i;
			})
			.attr('class', 'path-vertices')
			.attr('d', function(d) {
				var coords = [_this.centerPt, d];
				return _this.line(coords);
			});
	},

	addVoronoi: function(svg) {
		var _this = this;

		var vWrapper = svg.append('g')
			.attr('id', function(d) {
				return 'voronoiWrapper-' + d.id;
			});

		vWrapper.selectAll('.path-voronoi')
			.data(_this.voronoi(_this.vertices_s))
			.enter().append('path')
			.attr('id', function(d, i) {
				var id = this.parentNode.id,
					idNum = id.split('-')[1];
				return 'js-voronoi-' + idNum + '-' + i;
			})
			.attr('class', 'path-voronoi')
			.attr('d', _this.rawLine)
			.on('mouseover', function(d, i) {
				var ids = d3.select(this).attr('id').split('-'),
					distill_id = parseInt(ids[2], 10),
					index = parseInt(ids[3], 10);

				var taste = info.tastes[index],
					val = info.list[distill_id][taste],
					vCoord = _this.vertices[i];

				var f = d3.select('#js-focus-'  + distill_id),
					vert_path = d3.select('#js-vertice-'  + distill_id + '-' + i);

				d3.selectAll('#section-' + distill_id  + ' .path-vertices').style('display', 'none');
				vert_path.style('display', 'block');
				f.style('display', null);
				f.attr('transform', 'translate(' + vCoord[0] + ',' + vCoord[1] + ')');

				var this_section = document.getElementById('js-section-' + distill_id),
					taste_label = this_section.getElementsByClassName('label-taste')[0];

				taste_label.innerHTML = taste + ': ' + val;
			})
			.on('mouseout', function(d) {
				d3.selectAll('.path-vertices').style('display', null);
				d3.selectAll('.focus').style('display', 'none');
				var taste_lables = document.getElementsByClassName('label-taste');
				for (var i = 0; i < taste_lables.length; i += 1) {
					taste_lables[i].innerHTML = '';
				}
			});
	},

	getVertices: function() {
		var _this = this,
			v = [];

		for (var i = 0; i < _this.numSides; i += 1) {
			var angle = (_this.a * i) - (_this.a * 3),
				radian = (angle * Math.PI) / 180,
				xCoord = _this.getXCoord(radian, _this.r) + _this.r,
				yCoord = _this.getYCoord(radian, _this.r) + _this.r,
				coord = [xCoord, yCoord];

			v.push(coord);
		}

		var extra = v[0];
		v.push(extra);

		return v;
	},

	getAvgPath: function(data) {
		var _this = this,
			ap = [];

		info.tastes.forEach(function(d, i) {
			var angle = (_this.a * i) - (_this.a * 3),
				radian = (angle * Math.PI) / 180,
				avgRadius = (data[d] + 1) * _this.mult,
				xCoord = _this.getXCoord(radian, avgRadius) + _this.r,
				yCoord = _this.getYCoord(radian, avgRadius) + _this.r,
				coord = [xCoord, yCoord];

			ap.push(coord);
		});

		var extra = ap[0];
		ap.push(extra);

		return ap;
	},

	getXCoord: function(angle, radius) {
		var coord = Math.cos(angle) * radius,
			coordRound = Math.round(coord);
		return coordRound;
	},

	getYCoord: function(angle, radius) {
		var coord = Math.sin(angle) * radius,
			coordRound = Math.round(coord);
		return coordRound;
	}
};

var panel = {
	$parent: document.getElementById('js-panel'),
	$arrow: document.getElementById('js-panelArrow'),

	init: function() {
		var _this = this,
			$sections = document.getElementsByClassName('section');

		for (var i = 0; i < $sections.length; i += 1) {
			$sections[i].addEventListener('click', _this.panelDrop, false);
		}
	},

	panelDrop: function() {
		var _this = panel,
			$section = this,
			id = _this.getSectionId($section.id),
			oIndex = helpers.getIndex(info.collection, id),
			row = Math.floor(oIndex / list.numInRow),
			newRow = info.row === row ? false : true,
			panelIsDown = _this.$parent.classList.contains('is-down') ? true : false;

		if ($section.classList.contains('is-active')) {
			console.log('option 1')

			_this.slidePanelUp();
			_this.removeActive();

		} else if (!newRow && panelIsDown) {
			console.log('option 2')

			var rowPos = ((oIndex + list.numInRow) % list.numInRow);

			_this.queueNewPanel($section, id, rowPos);

		} else {
			console.log('option 3')

			var rowPos = ((oIndex + list.numInRow) % list.numInRow),
				afterId = _this.getAfterId(oIndex),
				$beforeChild = document.getElementById('js-section-' + afterId);

			queue().defer(_this.slidePanelUp)
				.await(function() {
					_this.queueNewPanel($section, id, rowPos);
					_this.slidePanelDown($beforeChild);
					info.row = row;
				});
		}
	},

	getSectionId: function(id) {
		var ids = id.split('-'),
			i = ids[2],
			num = parseInt(i, 10);

		return num;
	},

	queueNewPanel: function($section, id, rowPos) {
		var _this = this;

		_this.populatePanel(id, rowPos);
		_this.removeActive();
		$section.classList.add('is-active');
		$.smoothScroll({ scrollTarget: '#js-section-' + id });		
	},

	populatePanel: function(id, rowPos) {
		var _this = this,
			d = info.list[id],
			$names = _this.$parent.getElementsByClassName('js-panelName');

		for (var i = 0; i < $names.length; i += 1) {
			$names[i].innerHTML = d.name;
		}

		_this.$parent.getElementsByClassName('js-panelRegion').innerHTML = d.region;

		_this.$arrow.style.left = ((rowPos * list.sectionw) + (list.sectionw / 2) - 60) + 'px';

		results.getResults(id);
	},

	removeActive: function() {
		var $active = document.getElementsByClassName('is-active');
		for (var i = 0; i < $active.length; i += 1) {
			$active[i].classList.remove('is-active');
		}
	},

	slidePanelUp: function(callback) {
		var _this = panel;

		$(_this.$parent).slideUp(200, function() {
			_this.$parent.classList.remove('is-down');
			info.row = null;
			if (callback) callback();
		});
	},

	slidePanelDown: function($beforeChild) {
		var _this = this;

		list.$parent.insertBefore(_this.$parent, $beforeChild);
		_this.$parent.classList.add('is-down');
		$(_this.$parent).slideDown(200);
	},

	getAfterId: function(index) {
		var remainder = ((index + list.numInRow) % list.numInRow),
			plusRemainder = list.numInRow - remainder,
			afterId = info.collection[index + plusRemainder];

		return afterId;
	}

};

var results = {
	$parent: document.getElementById('js-panelResults'),

	getResults: function(id) {
		var _this = this,
			slug = info.list[id].slug,
			simList = info.lookup[slug].splice(0, 10),
			results = [];

		_this.$parent.innerHTML = '';

		simList.forEach(function(d) {
			var $result = document.createElement('div'),
				$name = document.createElement('p');

			$name.innerHTML = d.distillery;
			$result.appendChild($name);
			_this.$parent.appendChild($result);
		});

	}
};

var helpers = {
	slugify: function(t) {
		var slug = t.toLowerCase().replace(/[^\w ]+/g,'').replace(/ +/g,'-');
	    return slug;
	},

	valSort: function(a, b) {
		if (a.val < b.val) {
			return -1;
		} else if (a.val > b.val) {
			return 1;
		} else {
			return 0;
		}
	},

	getIndex: function(array, id) {
		var index;

		array.forEach(function(d, i) {
			if (d === id) {
				index = i;
			}
		});

		return index;
	}
};






// map stuff

var drawMap = function() {
	var w = document.getElementById('map').offsetWidth,
		h = document.getElementById('map').offsetWidth * 2;

		console.log(w, h)

	var projection = d3.geo.mercator()
		.center([0, 55.4])
		.rotate([4.4, -1.5])
		// .scale(4500)
		.scale(3000)
		.translate([w / 2, h / 2]);

	var countryPath = d3.geo.path().projection(projection);

	var svg = d3.select('#map')
		.append('svg')
		.attr('width', w)
		.attr('height', h)
		.append('g');

	d3.json('data/scotland-topo.json', function(error, scotland) {

		var scotland = topojson.feature(scotland, scotland.objects.scotland);

		svg.append('path')
			.datum(scotland)
			.attr('class', 'country-path')
			.attr('d', countryPath);

		drawDistills(svg, projection);
	});
};

var drawDistills = function(svg, projection) {
	d3.csv('data/whisky-data.csv', function(error, places) {

		places.forEach(function(d) {
			var ref = [d['Latitude'], d['Longitude']],
				gridref = OsGridRef(ref[0], ref[1]),
				latlng = OsGridRef.osGridToLatLong(gridref);

			d.lat = latlng._lat;
			d.lon = latlng._lon;
		});

		svg.selectAll('.distillery')
			.data(places)
			.enter().append('circle')
			.attr('class', function(d) {
				return 'places places-' + d['Distillery'];
			})
			.attr('r', 4)
			.attr('cx', function(d) {
				var coords = projection([d.lon, d.lat]);
				return coords[0];
			})
			.attr('cy', function(d) {
				var coords = projection([d.lon, d.lat]);
				return coords[1];
			});
	});
};


